import React from 'react';
import './Header.css';


function Header() {
  return (
    <div className='header'>
        <div className='logo'>
            <h1>SnapLib Inc.</h1>
        </div>
        <div className='navb'>
            <h>Home</h>
            &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
            <h>Photography</h>
            &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
            <h>Gallery</h>
            &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
            <h>About</h>
            &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
            <h>Contact</h>
            &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        </div>
    </div>
  );
};

export default Header;
